The Dennis Prager Radio Show MAR-04-2013 MON




Prager 20130304  3 The State of the GOP

Prager H3: Mark Isler fills in for Dennis. Mark continues with John Lott, and is joined in studio by
 Shawn Steel, Matt McReynolds, Harmeet Dhillon, and Steve Munisteri to discuss the state
 of the Republican party.


Prager 20130304  2 Gun Grab

Prager H2: Mark Isler fills in for Dennis. Mark talks with Andrew C. McCarthy, 
 his latest book: Spring Fever    The Illusion of Islamic Democracy.
 Mark is then joined by John Lott to talk gun control, his latest book is 
 At The Brink    Will Obama Push Us Over the Edge.


Prager 20130304  1 Sea Crustaceans

Prager H1: Mark Isler fills in for Dennis. After his visit to N. Korea, Dennis Rodman reports that
 Kim Jong-Un is a ''great guy.''
 Maxine Waters is worried that sea crustaceans will cost us 170 million jobs.
 Would life have been different had Mitt Romney won the election?
 What are your critiques of President Obama thus far? Callers weigh in.












